('00736b9d-cdc2-4577-a6e6-efddebf46c58', 'Phòng Master Tolet riêng Căn hộ Chung cư Era Town Đức Khải, Phường Phú Mỹ, Quận 7', '4', 'OOPN', 'Địa chỉ: Nguyễn Lương Bằng, Phường Phú Mỹ, Quận 7, Hồ Chí Minh', '3b9e3d80-2a1f-470f-a4e6-14aa4e0041cd', 'CTPT', '3U5N', '2UMD', 'CUID', '[\"Chính chủ cho thuê phòng trọ trong căn hộ Chung cư Era Town Đức Khải.\",\"Khu chung cư rộng rãi, thoáng mát , an ninh, tiện ích đầy đủ , tổng diện tích hơn 10ha với hơn 3000 căn hộ, cư dân đông đúc, đường xá rộng rãi, thông thoáng kết nối giao thông thuận tiện với các quận, trường học -chợ đi bộ ngay dưới chung cư. Cây xanh và bờ sông bao quanh khu này cực mát nhé mọi người.\",\"- Phòng master 15m2 toilet riêng có ít nội thất giá 3tr\",\"- Phòng master 18m2 trống giá 3tr2\",\"- Phòng master 18m2 có máy lạnh bàn giá 3tr4\",\"- Phòng master 25m2 trống giá 3tr6\",\"- Phòng master 27m2 toilet riêng góc 2 view cửa sổ lớn view sông có nội thất máy lạnh, máy nước nóng giá 3tr8\",\"- Phòng Tolet chung 1 người ở giá 1tr- 2tr2.\",\"Tất cả các phòng đều có tủ lạnh máy giặt bên ngoài sử dụng .Khu bếp và ban công giặt phơi rộng rãi.\",\"Quan tâm LH sđt hoặc nhắn zalo nếu cần thêm thông tin. Vui lòng đọc kỹ bài đăng của mình.\",\"Chủ nhà thân thiện, hoà đồng, tâm lý.\",\"Xin cảm ơn..!\"]', '7bca9c22-9fc1-4352-bad8-6387a2d122b6', '7c4ae49f-3257-43d8-acc5-9aeaaa242f02', 'd4db27d4-7a3a-45d1-a21b-d81a385c5495', 3, 27, '2024-08-01 09:44:24', '2024-08-01 09:44:24'),
('096f1c52-21c6-44ac-a051-ae69289d6f7f', 'Cho thuê nhà mới nguyên căn 1745 Huỳnh Tấn Phát TT Nhà Bè đối diện chợ phú xuân', '4', 'ONNB', 'Địa chỉ: Đường Huỳnh Tấn Phát, Thị trấn Nhà Bè, Huyện Nhà Bè, Hồ Chí Minh', '22975d1a-714e-4def-9b4d-accacf5cb689', 'NCT', '5U7N', '7UMD', 'CUID', '[\"Cho thuê nhà mặt tiền bên hông cầu phú xuân Kp4, thị trấn Nhà Bè giáp Q7, ngay cầu Phú Xuân 2\",\"Nhà mới trệt lầu bao gồm 2 phòng ngủ , kho chứa đồ, ban công, 2 toilet trên dưới, bếp phòng khách, sân để xe\",\"Khu vực đông đối diện chợ, vừa ở vừa kinh doanh buôn bán được\",\"Ưu tiên cho thuê dài hạn, giảm năm đầu 5tr\",\"Liên hệ chủ nhà : A Long 0766802468\"]', 'e52faec6-51c6-4e28-af3d-36eab1512c45', '5d436495-ea2e-43cd-b1e6-98b78dd3a14f', '9cb0403e-d194-4c04-8ead-7bb333253f69', 5, 70, '2024-08-01 09:44:24', '2024-08-01 09:44:24'),
('0f1465c1-601b-4539-9243-80bef5905eba', 'Cho thuê nhà riêng 33 phố Đốc Ngữ, Ba Đình, HN', '4', 'OBNN', 'Địa chỉ: 33 Phố Đốc Ngữ, Phường Liễu Giai, Quận Ba Đình, Hà Nội', 'dff1bc7d-2819-425e-a6bb-b66471611690', 'NCT', '3U5N', '3UMD', 'NDOE', '[\"+ Tổng S sử dụng 37m²: Tầng 1 30m² + gác lửng 7m².\",\"+ Ưu điểm:\",\"Vị trí trung tâm giữa các quận Ba Đình, Đống Đa, Tây Hồ, Cầu Giấy, gần SVĐ Quần Ngựa, hồ Tây, BV Quân y 354 (phù hợp cho tất cả người đi làm, người già, trẻ nhỏ);\",\"Ngõ thông, rộng, 20m ra ô tô. Hướng Đông - Nam mát mẻ. Điện nước tự trả theo giá nhà nước. Đất chữ nhật, ở riêng không chung đụng;\",\"Hệ thống điện nguồn, chiếu sáng, điều hòa, bình nước nóng, máy lọc nước, máy giặt, bơm tăng áp đầy đủ.\",\"+ Nhược điểm:\",\"Nhà cấp 4. Tuy nhiên nhà trần cao chống nóng, thoáng trước sau, tường ốp gạch men, WC và bếp riêng biệt nên sạch và thoáng.\",\"+ Giảm giá cho HĐ thuê từ 1 năm.\"]', '87e81fcc-68f3-4093-85a0-566b1f6ae15d', 'de0cf34a-da30-4c49-87e5-1ec4502ba1a9', '8428c53e-7616-4a8a-9d38-d1b11571a295', 4.3, 37, '2024-08-01 09:44:24', '2024-08-01 09:44:24'),
