('cc5c38e9-5906-4a51-b522-8def5462ebfa', 'Chính chủ tòa nhà cho thuê Căn hộ đủ đồ tai Trần Quốc Hoàn - Giảm giá 50% cho khách thuê tháng đầu', '4', 'OUNA', 'Địa chỉ: Trần Quốc Hoàn, Phường Dịch Vọng Hậu, Quận Cầu Giấy, Hà Nội', '8f82ca7d-268d-47ff-87ee-cfdda0352641', 'CTCH', '3U5N', '2UMD', 'NDOE', '[\"Tòa nhà căn hộ 7 tầng - 20 phòng căn hộ cho thuê dài hạn.\",\"Diện tích 20-25-30m2\",\"Đủ đồ: Giường, Đệm, Tủ , Điều hòa, Nóng lạnh, Hầm để xe, khép kín\",\"Phù hợp với các bạn sinh viên, các đang đi làm, cặp vợ chồng trẻ, chuyên gia\",\"Giá thuê từ 3,5 triệu, 4 triệu , 4 ,5 triệu/ tháng\",\"Điện 3,5K/ số\",\"Nước 100k/ người\",\"Phí dịch vụ 50k ( wifi, máy giặt, điện hành lang, thang máy, đổ rác)\",\"Liên hệ; 091274.88.79\",\"Ưu tiên, giảm giá 50% cho khách đặt cọc thuê sớm.\"]', 'eafd8ec7-814c-48c5-ae03-abc5d0de565d', 'b0fb835e-7fbc-4dcb-b19f-e148511bdb25', '6612c7b9-db17-499b-b91d-326a5d2f5a42', 3.5, 20, '2024-08-01 09:44:24', '2024-08-01 09:44:24'),
('ccc57dc1-7c21-4a96-a96f-0f58306e8097', 'Cho thuê nhà riêng, Nguyên căn 90m2, Trung tâm thành phố Đà Nẵng', '4', 'OCNL', 'Địa chỉ: Phường Khuê Trung, Quận Cẩm Lệ, Đà Nẵng', '843f4418-2a73-4076-a9b3-5dc9f1737e87', 'NCT', '3U5N', 'EN9E', 'NNAE', '[\". Vị trí, diện tích: Khuê Trung, Cẩm Lệ, diện tích nhà 60m2 + gác lửng 20m2+ sân 30m2 kiệt rộng hơn 3m.\",\"2. Công năng, Tiện nghi: 1 phòng khách, một phòng ngủ, một bếp, 1 WC khép kín, có sẵn điều hòa, bình nóng lạnh, cửa sổ các phòng đều ngập tràn ánh sáng.\",\"3. Tiện ích: Nhà gần công viên thanh niên, đại học ngoại ngữ, ĐH kiến trúc, Không gian thoáng, cây cối mát mẻ, an ninh rất tốt, hoa nở quanh năm trước sân.\",\"4. Ưu đãi: Cho thuê lâu dài, điện, nước theo đơn giá nhà nước, chủ nhà thân thiện, không gian sống lý tưởng và phù hợp với vợ chồng trẻ. Có thương lượng nếu hữu duyên.\",\"5. Cọc 2tr, thanh toán 2th/lần.\",\"P/s: (Không làm việc với dịch vụ/môi giới)\"]', '90e6833b-f801-4332-a592-b720d05054f4', '5e143b5a-9934-4f1d-8982-407a80ddf75f', 'b423dd3b-2080-4abf-abdc-b6b6ba59b08b', 4.5, 90, '2024-08-01 09:44:24', '2024-08-01 09:44:24'),
('cd6a2505-6777-4db9-a82a-95378d752aac', 'Cho thuê nhà nguyên căn phố ThúyLĩnh, Lĩnh Nam, Hoàng Mai, HN', '4', 'OONM', 'Địa chỉ: Thúy Lĩnh, Phường Lĩnh Nam, Quận Hoàng Mai, Hà Nội', '79782b0f-b592-46e2-a8f2-0ef932f4a2fe', 'NCT', '3U5N', '5UMD', 'NDOE', '[\"Gia đình còn một căn nhà mái tôn lạnh muốn cho hộ gia đình thuê\",\"- Địa chỉ: Ngõ 83, ngách 49/48, Phố Thúy Lĩnh, Lĩnh Nam, Hoàng Mai, Hà Nội\",\"- Diện tích trong nhà; 40m2(1 phòng ngủ, 1 phòng khách, 1 phòng vệ sinh)\",\"- Diện tích gác lửng: 18m2\",\"- Diện tích sân vườn 17m2\",\"- Đồ có sẵn: 2 giường, 1 quạt trần, 1 kệ bồn rửa và chỗ để bếp đun, có đầu chờ máy giặt, điều hòa, bình nóng lạnh\",\"- Nhà độc lập 1 cổng ngõ: mặt ngõ xe ba gác vào được, ngõ cụt an ninh tốt, cách ngõ ô tô 20m\",\"- Đi lại thuận tiện các tỉnh, gần trường học, chợ, bệnh viện...\",\"- Giá cho thuê: 3.800.000đ( điện nước tính riêng)\",\"* Ai có nhu cầu xin liên hệ để biết thêm: Hotline: 0986415187 hoặc 0982274883\"]', 'aec920bb-8ae5-4050-aae7-ca66aefadbb2', '4758534d-c4e4-44e4-95dc-c7a2e8f2610d', 'b72def38-078e-4935-8d62-b1e65f8ba16d', 3.8, 55, '2024-08-01 09:44:24', '2024-08-01 09:44:24'),
('cfd46135-ab07-45f0-80cb-b90a210a1175', 'Cho thuê nhà chính chủ số 10 đường Mạc Đĩnh Chi, tổ 19, Phường Bắc Sơn, Thành phố Tam Điệp.', '4', 'OOHĐ', 'Địa chỉ: 10 Đồng Giao, Phường Bắc Sơn, Thành phố Tam Điệp, Ninh Bình', '4ae63c6d-704e-40d5-bc6b-428a4dc63c74', 'NCT', '3U5N', 'EN9E', 'NUBD', '[\"Thông tin mô tả về nhà ở chính chủ:\",\"1) Thiết kế nhà sạch, đẹp, thoáng, 3 phòng ngủ, 1 phòng có điều hòa, 1 phòng khách, 2 phòng vệ sinh, 1 phòng tắm có nóng lạnh, 1 tủ bếp hoàn thiện.\",\"2) Nước máy lọc sạch sẽ. Điện trả theo hóa đơn nhà nước. Nhà cửa sơn mới đẹp. Đường xá thuận tiện. Khu dân cư sinh sống ở đó rất tốt, xung quanh nhiều người là quân đội, công an và giáo viên, cách nhà tổ trưởng 50m, nhà văn hóa cách 100m. Tiện ích cuộc sống: trường học cấp 1, 2, 3(500m-1km), chợ (500m), bệnh viện(2km), Công Viên trung tâm thành phố (300m). Cách khu vực công và chính quyền (500m), Sân vận động thể thao (400m.)\",\"Hướng Đông Nam: khí hậu mát, ôn hòa, gió lành, lý tưởng\",\"3) Nằm ở vị trí đẹp, bằng phẳng, phong thủy tốt. đường rộng thoáng, ô tô vào được 2 chiều. Lối đi vào không có tranh chấp, thoáng sạch. Hợp đồng có chữ ký đầy đủ, hợp pháp. Ưu tiên cho thuê lâu dài.\",\"Địa chỉ chi tiết: Số 10 đường Mạc Đĩnh Chi, tổ 19, Phường Bắc Sơn, Thành phố Tam Điệp.\",\"Điện thoại liên hệ: 0967894225\"]', '727b460f-c20c-42d5-9f9d-3347433dc31a', 'a0dc1871-68e4-455f-8c56-b192eaaf768f', 'fb0d4bfc-7fdf-4bc8-b227-00f36a280cf6', 4, 100, '2024-08-01 09:44:24', '2024-08-01 09:44:24'),
('d1cedfd2-4b86-4ea6-b246-a841181d2063', 'Cho thuê rẻ mặt bằng 8 x 20m Nguyễn Trãi Bến Thành Q1 trung tâm TP.HCM', '4', 'OQMN', 'Địa chỉ: Nguyễn Trãi, Phường Bến Thành, Quận 1, Hồ Chí Minh', '49697402-e801-472a-8e50-5c0c52d4d0db', 'CTMB', 'EU5N', 'EN9E', 'CUID', '[\"- Cần cho thuê rẻ mặt bằng mặt tiền Nguyễn Trãi Phường Bến Thành trung tâm Q1 Thành Phố Sài Gòn, khu trí thức, văn phòng, kinh doanh buôn bán sầm uất.\",\"- Giao thông thuận tiện, tọa lạc ngay trung tâm thành phố, gần trung tâm thương mại, ngân hàng, siêu thị, khách sạn New World, Chợ Bến Thành…\",\"- Tiện nghi đầy đủ, DT: 8 x 20m trống suốt, thang máy, tiện mở văn phòng, Spa và các loại hình dịch vụ khác.\",\"- Giá cho thuê siêu rẻ cho tháng Giêng: 45 tr/ tháng, cọc 3 tháng, thanh toán đầu tháng, hợp đồng dài hạn.\",\"- Vui lòng liên hệ A Sơn 0817.40.96.96\"]', 'e8951576-e97e-4770-8790-69bdb600a724', 'd5e39b53-d076-424f-9870-265b219c7c9e', 'c421f1cc-1b7f-495f-a2de-b7ff4324267e', 40, 160, '2024-08-01 09:44:24', '2024-08-01 09:44:24'),
('d3336390-3ef7-4d1a-a8d4-8c2e5c1dc85a', 'CHO THUÊ PHÒNG TRỌ MỚI CHÍNH CHỦ, GIẢM GIÁ, QUẬN TÂN PHÚ - GẦN BÊN TRƯỜNG ĐẠI HỌC CÔNG NGHỆ THỰC PHẨM', '4', 'OAHN', 'Địa chỉ: 24 Đường Sơn Kỳ, Phường Sơn Kỳ, Quận Tân Phú, Hồ Chí Minh', '70cf3b94-d792-4fa6-96ad-ab5dc507d752', 'CTPT', '2U3N', '2UMD', 'CUID', '[\"PHÒNG TRỌ 24 SƠN KỲ TÂN PHÚ, GẦN ĐH CÔNG NGHỆ THỰC PHẨM\",\"- Cách trường Đại Học Công nghệ Thực Phẩm 700m, cách AeOnMall Tân Phú 500m, Gần eTown, PanDoRa Trường Chinh,.... thuận tiện đi lại các quận.\",\"- Phòng có CỬA SỔ, nhiều phòng có BAN CÔNG, đảm bảo ánh sáng ban ngày rất thoáng mát. (Xem hình thật)\",\"- Toilet trong phòng đầy đủ các thiết bị vệ sinh, có kệ BẾP nấu ăn, có GÁC LỮNG các phòng được ốp gạch cao sạch sẽ.\",\"- Trong nhà có Thang máy đi lại, Có Camera an ninh quan sát, có PCCC tự động\",\"- Internet cáp quang mạnh, nhanh. Có cáp Tivi\",\"- Bỏ xe dưới tầng trệt có bảo vệ trong coi. Khóa vân tay giờ giấc tự do.\",\"- Bảo vệ trong coi 24/24 (không chung chủ) giúp Bạn có cảm giác an toàn, được bảo vệ.\",\"___________________________\",\"- Địa chỉ: 24 Sơn Kỳ, phường Sơn Kỳ, quận Tân Phú, Tp. Hồ Chí Minh.\",\"- Diện tích phòng: Từ 20 m2 – 25 m2.\",\"- Giá Rẻ: 2.8tr /tháng.\",\"___________________________\",\"(MỜI BẠN ĐẾN XEM PHÒNG, CÓ QUẢN LÝ TIẾP KHÁCH)\",\"Liên hệ: 0918 18 00 57 hoặc 0931897679  A Hiếu.\"]', '1369ae70-0bc9-4f7e-aea7-dea3f7ca4957', 'fcd6fba2-6fd9-44f3-b00e-4ffab9fd2728', '238aa309-4244-478d-ae7c-aa90654544d4', 2.8, 20, '2024-08-01 09:44:24', '2024-08-01 09:44:24'),
('d676a457-fe41-4d42-bc6d-1f67329e5e5c', 'Phòng mới sạch sẽ, an ninh, thoáng mát Chung cư Long Sơn mặt tiền Huỳnh Tấn Phát , Quận 7.', '4', 'OOPN', 'Địa chỉ: 1349 Đường Huỳnh Tấn Phát, Phường Phú Thuận, Quận 7, Hồ Chí Minh', '68b7b3e9-f934-4dd1-b611-e74d260d728e', 'CTPT', '2U3N', 'ON2E', 'CUID', '[\"Cần cho thuê\",\"Phòng 13-15m2 tolet chung 2tr-2tr2 cửa sổ lớn tường nguyên thuỷ view phú mỹ hưng. Phòng 10m2 thông gió giá 1tr7.\",\"Phòng master 23m2 giá 3tr3 tolet riêng khép kín trong phòng .\",\"Phòng kiểu studio có kệ bếp nấu ăn riêng giá 3tr8.\",\"Có tủ lạnh, máy giặt , khu phơi sử dụng thoải mái ít người .\",\"( Phòng studio chung cư xung quanh trên mặt tiền Huỳnh Tấn Phát này giá đã từ 5tr5-6tr5 )\",\"Những điểm mạnh tại chung cư là mặt tiền đường lớn thuận tiện đi lại và nhận giao hàng, không ngập nước, 2 hầm xe rộng rãi để gửi ô tô và xe máy, camera an ninh từng tầng, thang thoát hiểm phòng rác phòng điện phòng nước quản lỹ riêng biệt. Đặc biệt ít khách thuê phòng đa số là cư dân thuê nguyên căn hộ nên đi lại nhanh chóng, dân trí cao. Trong căn hộ có thông gió lấy sáng , gần bờ sông nên thoáng mát nhiều gió.\",\"- Không chung chủ, Giờ giấc tự do. Có tủ lạnh bảo quản thức ăn - nước uống và máy giặt dùng chung cho 1 căn hộ. Bảo vệ an ninh camera 24/24 ngoài hàng lang thang máy và trong căn hộ, mỗi tầng chỉ có 6 căn hộ, thiết kế căn hộ riêng biệt nên rất yên tĩnh.\",\"Wifi 5G mạnh vi vu. Có 2 tầng hầm gửi xe.\",\"Tiện ích ngay chung cư:\",\"- Có 8 tầng trung tâm thương mại cho thuê phía trước.\",\"- Kinh doanh Phòng Gym Power - Fisnet yoga, Sân chơi Gold 3D, Trung tâm anh ngữ ila, Văn phòng công ty\",\"- Ngay cạnh Phú Mỹ Hưng, Quận 7, Co. Op Mart, Crescent Mall, Cầu Phú Mỹ,...\",\"- Ngay mặt tiền đường Huỳnh Tấn Phát bán kính 100m xung quanh đầy đủ quắn ăn, cafe, gara, tạp hoá, siêu thị đầy đủ.\",\"Liên hệ hoặc nhắn zalo để thêm thông tin và hẹn xem phòng.\",\"Vui lòng đọc kỹ bài viết . Xin cảm ơn..!\"]', 'e4abe60c-27fe-403e-85f8-4b0b37d7d814', 'a7adbe87-00ce-48e