('fe95c6aa-16e0-42a0-9c36-0762f23a2063', 'KHAI TRƯƠNG CĂN HỘ DV FULL NỘI THẤT CAO CẤP GIÁ TỐT NHẤT Q12 - CÓ THANG MÁY - NHIỀU TIỆN ÍCH', '4', 'OVAA', 'Địa chỉ: 25A Đường Tân Chánh Hiệp 10, Phường Tân Chánh Hiệp, Quận 12, Hồ Chí Minh', '42a426bb-633b-458a-b227-5780ac72cca1', 'CTCH', '5U7N', '2UMD', 'CUID', '[\"CĂN HỘ MỚI XÂY - ĐẦY ĐỦ NỘI THẤT - HỆ THỐNG BẾP HIỆN ĐẠI\",\"- Giá chỉ từ.\",\"6.500.00 - 12.000.000/ tháng tùy theo DT 25m² - 40m².\",\"- Nội thất mới 100% - cửa sổ view đẹp.\",\"VỊ TRÍ: Ngay mặt tiền Trần Thị Năm - Cung đường Công viên phần mềm Quang Trung - Ngã tư An Sương.\",\"- Cách bệnh viện quận 12 chỉ 250m.\",\"- Cách Mega Market 1,5 km.\",\"- Cách cầu vượt An Sương 3km.\",\"- Trong bán kính 500m có đầy đủ tiện ích: Gym, trường mầm non, trường ngoại ngữ, điện máy xanh, bách hóa xanh, sân bóng đá, sân cầu lông,.\",\"TIỆN NGHI TÒA NHÀ\",\"- Có thang máy, camera an ninh, bảo vệ 24/24, hầm xe rộng rãi.\",\"- Thiết Kế Kính lớn sang trọng, hiện đại; cửa sổ View toàn cảnh.\",\"- Có tivi, rèm, tủ lạnh, máy lạnh, giường, tủ quần áo.\",\"- Hệ thống bếp hiện đại, đầy đủ đồ dùng bếp.\",\"- Sân thượng có máy giặt và khu phơi đồ.\",\"- Thiết kế đặc biệt với 3 bộ bàn ghế sang trọng dành cho: Sofa phòng khách, bộ bàn ăn, sofa phòng ngủ.\",\"- Có dịch vụ dọn vệ sinh.\"]', 'cb96c341-b820-4207-8264-886258c1c436', '1e0563c9-a76f-4d3d-b35c-ffe8732ddcce', '78c646e3-d33d-4fea-bbc0-bf00bcec2c08', 6.5, 25, '2024-08-01 09:44:24', '2024-08-01 09:44:24'),
('ffca5488-d506-453d-9ac1-3d6db6d9ea6d', 'Phòng trọ sang sạch sáng mát thơm hẻm 443 Điện Biên Phủ, Phường 3, Quận 3', '4', 'OOPN', 'Địa chỉ: Hẻm 443 Đường Điện Biên Phủ, Phường 3, Quận 3, Hồ Chí Minh', '7eaf369c-67c7-4bd4-a727-0911384ca126', 'CTPT', '3U5N', 'ON2E', 'CUID', '[\"- Nhà sạch sẽ, thoáng mát, an toàn và văn minh.\",\"- Cổng ra vào sử dụng khóa vân tay cùng camera quan sát 24/24 đảm bảo an ninh trật tự cho khu trọ.\",\"- Sân thượng phơi đồ rộng rãi, thoáng mát.\",\"- Phòng nước nóng, cửa sổ và wc riêng.\",\"- Không chung chủ, giờ giấc tự do thoải mái.\",\"- Có rất nhiều tiện ích xung quanh như nhà thờ, trường học, bệnh viện, nhà xe, chợ và siêu thị.\",\"- Đặc biệt bạn sẽ được miễn phí Wifi phủ sóng toàn khu trọ và khu vực công cộng sẽ được vệ sinh sạch sẽ MỖI NGÀY.\",\"- Hợp đồng lâu dài.\",\"- Giá thật hấp dẫn từ 4,5 triệu / 1 tháng\",\"Liên hệ: Chị Hoa: 0983422460- Vị trí gần ngay trung tâm rất thuận lợi cho việc đi lại ngay ngã tư Cao Thắng và Điện Biên Phủ.\"]', 'c15fe83f-2d52-493f-9261-24cdccb647eb', '032b09c1-cdd6-4ee0-8339-f26ac5c5250d', 'c86e6eb0-a1f7-422d-852c-0109beb383c4', 4.5, 18, '2024-08-01 09:44:24', '2024-08-01 09:44:24');
